import React from 'react'
import Todo from './Todo'
function TodoList({ todos, removeTodo, resolvedTodo }) {
    return (
        <div>
            {todos.map((todo) => (
                <Todo
                    resolvedTodo={resolvedTodo}
                    removeTodo={removeTodo}
                    todo={todo}
                />
            ))}
        </div>
    )
}

export default TodoList
